= 1 / s - 1e-8\n\n## define some parameters\nmax_steps = 100\ntol = 1e-8\nbeta_hat = np.zeros(100) # initial guess\n\n\nwith performance_report(filename = \"linear_regression.html\"):\n\tfor k in range(max_steps):\n    \t\tXbeta = X.dot(beta_hat)\n    \t\tfunc = ((y - Xbeta)**2).sum()\n    \t\tgradient = 2 * X.T.dot(Xbeta - y)\n    \t\t## Update\n    \t\tobeta = beta_hat\n    \t\tbeta_hat = beta_hat - step_size * gradient\n    \t\tnew_func = ((y - X.dot(beta_hat))**2).sum()\n    \t\tbeta_hat, func, new_func = dask.compute(beta_hat, func, new_func)  # &lt;--- Dask code\n\n    \t\t## Check for convergence\n    \t\tchange = np.absolute(beta_hat - obeta).max()\n\n    \t\tif change &lt; tol:\n        \t\tbreak\n\nprint(beta_hat)\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"months":[0,4,8]},"id":"1559","type":"MonthsTicker"},{"attributes":{"months":[0,4,8]},"id":"1331","type":"MonthsTicker"},{"attributes":{"axis":{"id":"1292"},"coordinates":null,"group":null,"ticker":null},"id":"1295","type":"Grid"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1460","type":"AdaptiveTicker"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1461","type":"AdaptiveTicker"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1462","type":"AdaptiveTicker"},{"attributes":{"days":[1,15]},"id":"1466","type":"DaysTicker"},{"attributes":{},"id":"1127","type":"BasicTicker"},{"attributes":{"months":[0,6]},"id":"1470","type":"MonthsTicker"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&
